import React from 'react';
import './App.css';

function App() {
  return (
    <main>
      <header>
        <a href='#logo' className='logo'>MyBlog</a>
        <nav>
          <a href='#login'>Log in</a>
          <a href='#register'>Register</a>
        </nav>
      </header>
    </main>
  );
}

export default App;
